import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import App from './App';
import Finance from './Components/Finances/Finance';
import HumanResource from './Components/Human Resource/HumanResource'
import Inventory from './Components/Inventory Management/Inventory'
ReactDOM.render(
  <Router>
     <Routes>
       <Route path='/' element={<App/>} />
       <Route path='/finance' element={<Finance/>} />
       <Route path='/hr' element={<HumanResource/>} />
       <Route path='/inventory' element={<Inventory/>} />
     </Routes>
   </Router>,
   document.getElementById('root')
);
